  `is_deleted` char(1) DEFAULT 'N' COMMENT '是否删除（Y：是，N：否）',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=1020 DEFAULT CHARSET=utf8 COMMENT='商品';

