/*Table structure for table `cy_visits` */

DROP TABLE IF EXISTS `cy_visits`;

CREATE TABLE `cy_visits` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '主键',
  `session_id` varchar(64) NOT NULL COMMENT '会话ID',
  `ip` varchar(64) DEFAULT NULL COMMENT '访问IP',
  `page` varchar(200) DEFAULT NULL COMMENT '访问页面',
  `duration` bigint(20) DEFAULT NULL COMMENT '停留时间(秒)',
  `create_time` datetime NOT NULL COMMENT '创建时间',
  `update_time` datetime NOT NULL COMMENT '修改时间',
  `creator` varchar(10) NOT NULL DEFAULT 'SYSTEM' COMMENT '创建者',
  `modifier` varchar(10) NOT NULL DEFAULT 'SYSTEM' COMMENT '修改者',
  `extra_info` varchar(128) DEFAULT NULL COMMENT '扩展字段',
  `is_deleted` char(1) NOT NULL DEFAULT 'N' COMMENT '是否删除（Y：是，N：否）',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=118 DEFAULT CHARSET=utf8 COMMENT='访问量';

